import React from "react";
import { View, Text, StyleSheet } from "react-native";

const FoodCard = ({ food }) => {
  return (
    <>
      <Text>{food.food}</Text>
    </>
  );
};

const styles = StyleSheet.create({});

export default FoodCard;
